import React, {Component} from 'react';
import Todos from './components/Todos'
import './App.css';

function App() {
  state = {
    todos : [
      {
        id : 1,
        title : 'Trash'
      },
      {
        id : 2,
        title : 'Tip'
      },
      {
        id : 3,
        title : 'Hi'
      }
    ]
  }

  return (
    <div className="App">
      <Todos todos={this.state.todos}/>
    </div>
  );
}

export default App;
